import { makeStyles } from "@material-ui/core";
import { colors } from "../../../../../themes/colors";

export const useStyles = makeStyles((theme) => ({
    inputBox:{
        width:'80%',
        backgroundColor:colors.whiteTr,
        padding:'15px 0px'
    },
    Field:{
        marginBottom:15
    },
    Container:{
        backgroundColor:'#3333',
        width:"80%",
        display:'flex',
        justifyContent:'space-between',
        padding:10
    },
    item:{
        backgroundColor:'#444',
        margin:'10px 0'
    }
  }));
